import React from 'react';
import RsvpInfo from './components/rsvpinfo';

class RSVP extends React.Component {

    click(){
        console.log(this.props.auth);
    }


    render() {
        return (
            <div className="rsvp">
                <p onClick={this.click}>Rsvp Page</p>
            </div>
        )
    }
}

export default RSVP;
